import React from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";
import ContactForm from "../components/ContactForm";

function ContactPage() {
  return (
    <>
      <Header />
      <ContactForm />
      <Footer />
    </>
  );
}

export default ContactPage;
